import React from 'react';
import './App.css';

export function UploadDownload() {
  return (
    <div className="App">
      <div className="left-half">
        <div className="logo">FireFly</div>
        <div className="file-box">
          {/* Code for file box goes here */}
        </div>
      </div>
      <div className="right-half">
        <div className="pin-wrapper">
          <label htmlFor="pin-input">Enter 5-digit pin:</label>
          <input id="pin-input" type="text" maxLength="5" />
        </div>
        <button className="upload-btn">Upload</button>
      </div>
    </div>
  );
}
